import React, {useState} from 'react';
import {useDispatch} from "react-redux";
import {createGoods} from "../../actions/goods.js";


const Create = (props) => {
    const [name, setName] = useState("")
    const [cost, setCost] = useState("")
    const [descript, setDescript] = useState('');
    const [file, setFile] = useState('');
    const dispatch = useDispatch()
    

    return (
            <form >
                <input onChange={e => setFile(e.target.value)} type="file" value={file} accept="image/*"/>
                <input onChange={e => setCost(e.target.value)} type="text" value={name}/>
                <input onChange={e => setCost(e.target.value)} type="text" value={cost}/>
                <input onChange={e => setDescript(e.target.value)} type="text" value={descript}/>
                <button onClick={() => {dispatch(createGoods(name, cost, descript, file));}}>gf</button>
            </form>
    )
}

export default Create
